@Component({
  selector: 'app-skills',
  templateUrl: './skills.component.html',
  styleUrls: ['./skills.component.scss']
})
export class SkillsComponent {

  @Input() title:string = "Mes compétences"
  // @Input() subtitle1:string = ""
  @Input() subtitle2:string = "Mes compétences"
  @Input() subtitle3:string = "Mes compétences"

}
